function procCmd(cmd) {
    var splitted = cmd.split(" ");
    if (splitted[0] != "blre") return;
    switch (splitted[1]) {
        case "start":
            clientMessage("Tap a block you want to replace.");
            mode = MODE_TAP;
            break;
        case "cancel":
            if (mode != MODE_WAITING) clientMessage("Operation cancelled.");
            else clientMessage("No operation waiting.");
            mode = MODE_WAITING;
            break;
        case "undo":
            if (undone.size() == 0) {
                clientMessage("Nothing to undone.");
                return;
            }
            var list = new java.util.ArrayList(undone.entrySet());
            for (var i = 0; i < list.size() ; i++) {
                var entry = list.get(i);
                var where = entry.getKey();
                var block = entry.getValue();
                var x = parseInt(where.split(":")[0]);
                var y = parseInt(where.split(":")[1]);
                var z = parseInt(where.split(":")[2]);
                var bid = parseInt(block.split(":")[0]);
                var bdm = parseInt((block + ":0").split(":")[1]);
                Level.setBlock(x, y, z, bid, bdm);
            }
            clientMessage("Undone complete.");
            break;
        case "gc":
            clientMessage("Cancelling operation...");
            mode = MODE_WAITING;
            clientMessage("Deleting undone cache...");
            undone.clear();
            break;
    }
}